import React from 'react'

import {BrowserRouter, Route, Switch, Redirect} from 'react-router-dom'

import Layout from './UI/Layout'
import Contests from './CONTAINERS/Contests'

const App = () => {
  return (
  	<BrowserRouter>
	  	<div>
		    <Layout>
			  <Route path  ="/contests" component = {Contests} exact/>		    	
		    </Layout>
	    </div>
    </BrowserRouter>
  )
}

export default App;
